import { aboutPicture1, aboutPicture2, aboutPicture3, aboutPicture5, aboutPicture6} from "../../assets"

const aboutPictures = [
  {
    id: 1,
    title: "1",
    image: aboutPicture1,
  },
  {
    id: 2,
    title: "2",
    image: aboutPicture2,
  },
  {
    id: 3,
    title: "3",
    image: aboutPicture3,
  },
  {
    id: 4,
    title: "4",
    image: aboutPicture5,
  },
  {
    id: 5,
    title: "5",
    image: aboutPicture6,
  },
];

export default aboutPictures;
